import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { useUserAuth } from '../context/UserAuthContext';

export default function Notes() {
    const {user} = useUserAuth();
    console.log(user);
  return (
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 1,
          width: 300,
          height: 300,
          
        },
      }}
    >
      <Paper elevation={0} />
      <Paper /> 
      <Paper elevation={4} />
    </Box>
  );
}
